import {useState} from "react";
function App() {
  let [number, myNumber] = useState(0);
  let [name, myName] = useState(0);
  const increaseBtn=()=> {
    myNumber(number + 1);
    myName()
  }
  return (
    <>
      <h1>{number}</h1>
      <button onClick={increaseBtn}>click</button>
    </>
  );
}
export default App;
